import React from "react";
import { animated, useSpring, config } from "react-spring";
import { easeSinInOut, easeSinIn, easeExpIn } from "d3-ease";
import styled from "styled-components";
import amazonLogo from "../../imgs/amazonLogo.jpg";
import christLogo from "../../imgs/christLogo.png";
import swarovskiLogo from "../../imgs/swarovskiLogo.jpg";
import leftPicArrow from "../../imgs/leftPicArrow.png";
import rightPicArrow from "../../imgs/rightPicArrow.png";
////////////////////////////////////////////////////////////////
////////////////////////////////////////////////////////////////
////////////////////////////////////////////////////////////////
const StyledDiv = styled.div`
  display: flex;
  width: 90%;
  height: 350px;
  left: 0;
  right: 0;
  margin: auto;
  margin-top: 20px;
  border: 1px solid black;
`;
const StyledList = styled.div`
  display: flex;
  width: 100%;
  height: 250px;
  justify-self: center;
  align-self: center;
  justify-content: center;
  gap: 20px;
  align-items: center;
  list-style-type: none;
`;
const StyledListItems = styled.div`
  width: 330px;
  height: 160px;
  cursor: pointer;
  img {
    width: 100%;
    height: auto;
  }
`;
////////////////////////////////////////////////////////////////
////////////////////////////////////////////////////////////////
////////////////////////////////////////////////////////////////
function SetProducts({ deactProd, shopList }) {
  const [picMid, setPicOrder] = useSpring(()=>({}))
  return (
    <StyledDiv>
      <div
        style={{
          width: "50px",
          height: "50px",
          alignSelf: "center",
          justifyItems: "flex-start",
        }}
      >
        <img
          src={leftPicArrow}
          alt="LeftArrow"
          style={{ width: "100%", height: "100%" }}
        ></img>
      </div>
      <StyledList>
        
          
          <img
            src={amazonLogo}
            alt="Amazon"
            onClick={() => deactProd(1)}
            style={{ opacity: shopList[0]["enabled"] ? "1" : "0.3" }}
          />
        
          <img
            src={christLogo}
            alt="Christ"
            onClick={() => deactProd(2)}
            style={{ opacity: shopList[1]["enabled"] ? "1" : "0.3" }}
          />
        
      </StyledList>
    </StyledDiv>
  );
}

export default SetProducts;
